import { memo } from "react";
import './style.scss';

const Header = () => {
  return (
    <div className="header_top">
      <div className="container">Header</div>
      <div className="row">
        <div className="col-6">Left</div>
        <div className="col-6">Right</div>
      </div>
    </div>
  )
};

export default memo(Header);
